  <script>
    const svg = d3.select('svg');
    const title = 'Massachusetts Population Density';
    const subtitle = 'Based on 2014 Census Data';
    const width = +svg.attr('width');

    svg
      .insert('text',':first-child')
      .attr('x', (width / 2))
      .attr('y', 100)
      .attr('text-anchor', 'middle')
      .style('font-size', '3rem')
      .style('fill', 'black')
      .style('font-weight', 'bold')
      .text(title)
    svg
      .insert('text',':nth-child(2)')
      .attr('x', (width / 2))
      .attr('y', 150)
      .attr('text-anchor', 'middle')
      .style('font-size', '2rem')
      .style('fill', 'black')
      .style('font-weight', 'bold')
      .text(subtitle);
  </script>
